import React from 'react';
import { Grid, Card, CardContent, CardMedia, Typography, IconButton } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';

const MemeList = ({ memes, removeMeme }) => {
    return (
        <Grid container spacing={4}>
            {memes.map((meme) => (
                <Grid item key={meme._id} xs={12} sm={6} md={4}>
                    <Card>
                        {meme.imageUrl && (
                            <CardMedia
                                component="img"
                                height="140"
                                image={meme.imageUrl}
                                alt={meme.text}
                            />
                        )}
                        <CardContent>
                            <Typography variant="h6">{meme.text}</Typography>
                            <IconButton aria-label="delete" onClick={() => removeMeme(meme._id)}>
                                <DeleteIcon />
                            </IconButton>
                        </CardContent>
                    </Card>
                </Grid>
            ))}
        </Grid>
    );
};

export default MemeList;
